import listUpload from "views/list-upload/list-upload.jsx";

var routes = [
  {
    path: "/index",
    name: "List File",
    icon: "ni ni-tv-2 text-primary",
    component: listUpload,
    layout: "/admin"
  },
  {
    path: "/inbox",
    name: "Inbox",
    icon: "ni ni-tv-2 text-primary",
    component: listUpload,
    layout: "/admin"
  },
  {
    path: "/index",
    name: "List File",
    icon: "ni ni-tv-2 text-primary",
    component: listUpload,
    layout: "/admin"
  },

];
export default routes;
